import React from 'react';

const Videos = (props) => {
  const { match } = props;

  if (match.length <= 0) {
    return (<div></div>)
  } else {

    return (
      <div>
        {match.map((video, i) => (
          <div>
            {i === 0 &&
              <div className='card mb-1'>
                <div className='card-body p-3'>
                  <img className='home-center-series-videos-large'
                    src={video.med_image} alt="no Iamge" />
                  <div className="home-center-videos-title">
                    {video.title}
                  </div>
                </div>
              </div>
            }

            {i > 0 &&
              <div key={video.id} className="flex-d">
                <div className="card mb-1 p-0">
                  <div className="card-body p-3">
                    <div>
                      <img
                        className="home-center-series-videos-small"
                        src={video.med_image}
                        alt="no Iamge"
                      />
                    </div>

                    <div>
                      {/* <h6 className='home-center-series-article-videos-small-date'>
                      {Moment(
                        new Date(video.created_at)
                      ).format("DD MMM,YYYY")}
                    </h6> */}

                      <h6 className='home-center-series-videos-small-text' >
                        {video.title}
                      </h6>

                      <h6 className='home-center-series-videos-small-text'>
                        {video.match_desc}
                      </h6>
                    </div>
                  </div>
                </div>
              </div>
            }

          </div>
        ))}
      </div>
    )
  }
}

export default Videos;
